import React from "react";
import { useNavigate } from "react-router-dom";
import "./MenuDropDown.css";

const MenuDropDown = ({ onLogout }) => {
    const navigate = useNavigate();

    return (
        <div className="dropdown">
            <ul className="dropdown-menu">
                <li className="dropdown-item" onClick={() => navigate("/account")}>
                    Trang Tài Khoản
                </li>
                <li className="dropdown-item" onClick={() => navigate("/orders")}>
                    Đơn Hàng
                </li>
                <li className="dropdown-item" onClick={() => navigate("/profile")}>
                    Tài Khoản
                </li>
                <li className="dropdown-item" onClick={() => navigate("/transactions")}>
                    Lịch Sử Giao Dịch
                </li>
                <li className="dropdown-item logout" onClick={onLogout}>
                    Đăng Xuất
                </li>
            </ul>
        </div>
    );
};

export default MenuDropDown;
